$(window).load(function() {

  function ratioPhoto(block) {
    $(block).each(function(){
      var itemWidth = $(this).width();
      var itemHeight = $(this).height();
      var itemRatio = itemHeight / itemWidth;

      var photo = $(this).find('img');
      var photoWidth = photo.width();
      var photoHeight = photo.height();
      var photoRatio = photoHeight / photoWidth;

      // if ( itemRatio < photoRatio ) {
      //   photo.width('100%');
      //   photo.height('auto');
      // } else if (itemRatio > photoRatio) {
      //   photo.height('100%');
      //   photo.width('auto');
      // } else {
      //   photo.width('100%');
      //   photo.height('auto');
      // }

      if ( itemRatio < photoRatio ) {
        $(photo).attr({
          "width": "100%",
          "height": "auto"
        });
        // photo.width('100%');
        // photo.height('auto');
      } else if (itemRatio > photoRatio) {
        $(photo).attr({
          "width": "auto",
          "height": "100%"
        });
        // photo.height('100%');
        // photo.width('auto');
      } else {
        $(photo).attr({
          "width": "100%",
          "height": "auto"
        });
        // photo.width('100%');
        // photo.height('auto');
      }
    });
  }

  function ratioLetter(block) {
    $(block).each(function(){
      var itemWidth = $(this).width();
      var itemHeight = $(this).height();
      var itemRatio = itemHeight / itemWidth;

      var photo = $(this).find('img');
      var photoWidth = photo.width();
      var photoHeight = photo.height();
      var photoRatio = photoHeight / photoWidth;

      if ( itemRatio > photoRatio ) {
        $(photo).attr({
          "width": "100%"
        });
        // photo.width('100%');
      } else if (itemRatio < photoRatio) {
        // photo.height('100%');
        $(photo).attr({
          "height": "100%"
        });
      } else {
        $(photo).attr({
          "width": "100%"
        });
        // photo.width('100%');
      }
    });
  }

  ratioPhoto('.offers-content__photo-box');
  ratioPhoto('.slider__item');
  // ratioPhoto('.city__photo');
  ratioPhoto('.excursion__photo');
  
  window.addEventListener("resize", function() {

    ratioPhoto('.offers-content__photo-box');
    ratioPhoto('.slider__item');
    // ratioPhoto('.city__photo');
    ratioPhoto('.excursion__photo');

  }, false);

  // $(window).resize(function(){
    

  // });

});
$(document).ready(function(){

  var elemSlider = $('.rooms-slider__item');
  var qltElemSlider = $(elemSlider).length;

  var thisNumElem = $('.rooms-slider__num-this');
  var allNumElem = $('.rooms-slider__num-full');

  if ( String(qltElemSlider).length < 2 ) {
    $(allNumElem).text('0'+qltElemSlider);
  } else {
    $(allNumElem).text(qltElemSlider);
  }


  for (var i = 0; i < qltElemSlider; ++i) {
    var num = i + 1;

    if ( String(num).length < 2 ) {
      $(thisNumElem).eq(i).text('0'+num);
    } else {
      $(thisNumElem).eq(i).text(num);
    }

  }

});

